        />
    }

    render() {
        return (
            <div>
                <div className="board-row">
                    {this.props.whiteFallenSoldiers.map((ws, index) => this.renderSquare(ws, index))}
                </div>
                <div className="board-row">
                    {this.props.blackFallenSoldiers.map((bs, index) => this.renderSquare(bs, index))}
                </div>
            </div>
        );
    }
}
